-- DROP TABLE `ying`.`hs_s_loan_EM`;
CREATE TABLE `hs_s_loan_EM` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(6) DEFAULT NULL COMMENT 'code',
  `fMKT` tinyint(1) unsigned DEFAULT NULL COMMENT 'fMKT',
  `name` varchar(18) DEFAULT NULL COMMENT 'name',
  `date` date DEFAULT NULL COMMENT 'date',
  `sCover` int(9) unsigned DEFAULT NULL COMMENT 'sCover',
  `sSell` int(9) unsigned DEFAULT NULL COMMENT 'sSell',
  `bStock` int(11) unsigned DEFAULT NULL COMMENT 'bStock',
  `mCover` bigint(11) unsigned DEFAULT NULL COMMENT 'mCover',
  `mBuy` bigint(11) unsigned DEFAULT NULL COMMENT 'mBuy',
  `bMargin` bigint(12) unsigned DEFAULT NULL COMMENT 'bMargin',
  PRIMARY KEY (`id`),
  UNIQUE KEY `KeyName` (`code`,`date`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8;


-- DROP PROCEDURE `ying`.`hs_s_loan_EM`;
DELIMITER $$
CREATE DEFINER=`gxh`@`%` PROCEDURE `hs_s_loan_EM`(IN code VARCHAR(18), fMKT VARCHAR(18), name VARCHAR(18), date VARCHAR(18), sCover VARCHAR(18), sSell VARCHAR(18), bStock VARCHAR(18), mCover VARCHAR(18), mBuy VARCHAR(18), bMargin VARCHAR(18))
BEGIN
SET code = IF(code = '', NULL, code);
SET fMKT = IF(fMKT = '', NULL, fMKT);
SET name = IF(name = '', NULL, name);
SET date = IF(date = '', NULL, date);
SET sCover = IF(sCover = '', NULL, sCover);
SET sSell = IF(sSell = '', NULL, sSell);
SET bStock = IF(bStock = '', NULL, bStock);
SET mCover = IF(mCover = '', NULL, mCover);
SET mBuy = IF(mBuy = '', NULL, mBuy);
SET bMargin = IF(bMargin = '', NULL, bMargin);

INSERT INTO `hs_s_loan_EM` (`code`, `fMKT`, `name`, `date`, `sCover`, `sSell`, `bStock`, `mCover`, `mBuy`, `bMargin`) VALUES (code, fMKT, name, date, sCover, sSell, bStock, mCover, mBuy, bMargin) 
ON DUPLICATE KEY UPDate 
`code` = IF(code IS NULL, `code`, code),
`fMKT` = IF(fMKT IS NULL, `fMKT`, fMKT),
`name` = IF(name IS NULL, `name`, name),
`date` = IF(date IS NULL, `date`, date),
`sCover` = IF(sCover IS NULL, `sCover`, sCover),
`sSell` = IF(sSell IS NULL, `sSell`, sSell),
`bStock` = IF(bStock IS NULL, `bStock`, bStock),
`mCover` = IF(mCover IS NULL, `mCover`, mCover),
`mBuy` = IF(mBuy IS NULL, `mBuy`, mBuy),
`bMargin` = IF(bMargin IS NULL, `bMargin`, bMargin);
END$$
DELIMITER ;

CALL hs_s_loan_EM('[标签:code]','[标签:fMKT]','[标签:name]','[标签:date]','[标签:sCover]','[标签:sSell]','[标签:bStock]','[标签:mCover]','[标签:mBuy]','[标签:bMargin]')


